The Honeymoon Murder: Who Killed Anni

Sociopolitical Documentary hosted by Jeremy Vine, published by BBC broadcasted as part of BBC Panorama series in 2013 - English narration


Information
------------------------------

When a beautiful young bride was murdered on her honeymoon in South Africa - allegedly on the orders of her British husband - it made headlines around the world. Nearly three years on, the truth about Anni Dewani's killing remains a mystery, while in July 2013 a British judge ordered Shrien Dewani - still sectioned under the mental health act in the UK - should be extradited to South Africa to stand trial. BBC Panorama has obtained the secret police files which make up the prosecution case against the 33-year-old Bristol businessman, and has commissioned leading forensic experts to review all the evidence. Their findings expose fundamental mistakes both in the police investigation and in the interpretation of forensic evidence. Could Shrien Dewani be - as he has always claimed - an innocent man?

